import React from "react";
import axios from "axios";
function Logout() {
    axios.get("http://localhost:4000/logout", { withCredentials: true })
        .then(res => {
            console.log(res.data);
            window.location.assign('/');
        }).catch(err => console.log(err));

}
export default Logout;
